package biweekly.biweekly32;

import java.util.HashMap;
import java.util.Map;

/**
 * Created on:  Aug 08, 2020
 * Questions: https://leetcode.com/problems/can-convert-string-in-k-moves/
 */
public class CanConvertStringInKMoves {
    public static void main(String[] args) {
        System.out.println("************************** Solution 1 **************************");
        System.out.println(canConvertString("input", "ouput", 9));
        System.out.println(canConvertString("abc", "bcd", 10));
        System.out.println(canConvertString("aab", "bbb", 27));
        System.out.println(canConvertString("mygdwuntwkoc", "btydmdiatnhx", 48));
        System.out.println(canConvertString("jicfxaa",
                "ocxltbp",
                15));
        System.out.println(canConvertString(
                "",
                "",
                50539));
        System.out.println("************************** Solution 2 **************************");
        System.out.println(canConvertString_2("input", "ouput", 9));
        System.out.println(canConvertString_2("abc", "bcd", 10));
        System.out.println(canConvertString_2("aab", "bbb", 27));
        System.out.println(canConvertString_2("mygdwuntwkoc", "btydmdiatnhx", 48));
        System.out.println(canConvertString_2("jicfxaa",
                "ocxltbp",
                15));
        System.out.println(canConvertString_2(
                "",
                "",
                50539));
    }

    //    s = "input", t = "ouput", k = 9
    public static boolean canConvertString_2(String s, String t, int k) {
        if (s.length() != t.length()) return false;
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            int swaps = getShifts(s.charAt(i), t.charAt(i)), next = swaps + 26;
            if (swaps == 0) continue;
//            System.out.println("swaps = " + swaps + "\tmap = " + map);
//            Check if the current swap is done, then take teh precalculated next value swap value from the map.
            if (map.containsKey(swaps)) {
                if (map.get(swaps) > k) return false;
                next = map.get(swaps) + 26;
            }
            if (swaps > k) return false;
//            Pre-calculate the next swap value when same swaps are required.
            map.put(swaps, next);
        }
        return true;
    }

    public static boolean canConvertString(String s, String t, int k) {
        if (s.length() != t.length()) return false;
        int[] shifts = new int[s.length()];
        for (int i = 0; i < s.length(); i++) {
            shifts[i] = getShifts(s.charAt(i), t.charAt(i));
        }
        boolean[] visited = new boolean[k + 1];
        for (int shift : shifts) {
            if (shift == 0) continue;
//            Check if the letter can be shifted.
            int cur = shift;
            while (cur + 26 <= k && visited[cur]) {
                cur += 26;
            }
            if (cur <= k && !visited[cur]) {
                visited[cur] = true;
            } else {
                return false;
            }
        }
        return true;
    }

    private static int getShifts(char a, char b) {
        if (a == b) return 0;
        if (b > a) return b - a;
        return b - a + 26;
    }
}
